import ExpenseItem from "./ExpenseItem";
import "./Expenses.css"

function Expenses(props){
    return (
        <div>

            <h2>Let's get started!</h2>
            <ExpenseItem title={props.title[0].title} amount={props.amount[0].amount} date={props.date[0].date} />
            <ExpenseItem title={props.title[1].title} amount={props.amount[1].amount} date={props.date[1].date} />
            <ExpenseItem title={props.title[2].title} amount={props.amount[2].amount} date={props.date[2].date} />
            <ExpenseItem title={props.title[3].title} amount={props.amount[3].amount} date={props.date[3].date} />
        </div>
    );
}

export default Expenses;
